アイコスケース/プル―ムテックケース<BR><BR>

アイコスがピッタリと入る専用設計！<BR>
カラビナ付きで、ジーンズやカバン等に引っかけられます。<BR><BR>

【カラー】オレンジ/ブラック/ホワイト/ライトブルー/ピンク/レッド/ブラック×レッド/ブラック×ホワイト/迷彩グリーン/迷彩ピンク<BR><BR>

【サイズ】<BR>
本体部分：約横60mm×約縦120mm×約マチ20mm<BR><BR>

<FONT color="#ff0033">※有料でデコパーツが付けられます！！</FONT><BR>
デコパーツでもっとオシャレに♪<BR><BR>
・デコステッカー(＋3,000円)<br>
・イニシャル・数字チャーム（＋400円）<br>
・シルバーチャーム（＋400円）<br>
・シルバーチャーム ペア（＋800円）<br>
・フックチャーム（+200円）<BR><BR>

画像をご覧ください。<BR><BR>

※送料無料ですが、沖縄・北海道・離島は別途送料がかかります。
<BR>
